export const SKILLS = [
    {
        title: "Frontend",
        icon: "./images/frontend.png",
        skills: [
            { skill: "Html5", percentage: "80%" },
            { skill: "Css3", percentage: "90%" },
            { skill: "JavaScript", percentage: "50%" },
            { skill: "React.js", percentage: "80%" }
        ]
    },
    {
        title: "Backend",
        icon: "./images/backend.png", // Path to backend icon
        skills: [
            { skill: "Node.js", percentage: "70" },
            { skill: "Express.js", percentage: "60" },
            { skill: "MongoDB", percentage: "70" },
            { skill: "SQL", percentage: "60" }
        ]
    },
    {
        title: "Tools",
        icon: "./images/tools.png", // Path to tools icon
        skills: [
            { skill: "Git", percentage: "80" },
            { skill: "Docker", percentage: "60" },
            { skill: "Webpack", percentage: "50" },
            { skill: "VS Code", percentage: "90" }
        ]
    },
    {
        title: "Soft Skills",
        icon: "./images/Skills.png", // Path to soft skills icon
        skills: [
            { skill: "Communication", percentage: "90" },
            { skill: "Problem Solving", percentage: "80" },
            { skill: "Teamwork", percentage: "85" },
            { skill: "Time Management", percentage: "90" }
        ]
    }
];
